import React from "react";
import "./Footer.css";
// import { FooterItems } from "./FooterItems";
// import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'

var phantom = {
  display: 'block',
  padding: '20px',
  height: '60px',
  width: '100%',
}

function Footer({ children }) {
    return (
        <div>
            <div style={phantom} />
            <div className="footer">
                { children }
              <h1>
                words
              </h1>
            </div>
        </div>
    )
}

export default Footer
